#include <iostream>
#include <vector>

using namespace std;

// This solution cost too much time on some test case.

class Solution
{
public:
  int partition(vector<int> &nums, int startIdx, int endIdx)
  {
    int pivotIdx = startIdx;
    int pivot = nums[pivotIdx];

    int forwardIdx = startIdx + 1;
    int backwardIdx = endIdx;

    while (forwardIdx <= backwardIdx)
    {
      bool isNumNotMoving = true;

      if (nums[forwardIdx] < pivot)
      {
        isNumNotMoving = false;
        forwardIdx++;
      }

      if (nums[backwardIdx] >= pivot)
      {
        isNumNotMoving = false;
        backwardIdx--;
      }

      if (isNumNotMoving)
      {
        int tmp = nums[forwardIdx];
        nums[forwardIdx] = nums[backwardIdx];
        nums[backwardIdx] = tmp;

        forwardIdx++;
        backwardIdx--;
      }
    }
    int tmp = nums[backwardIdx];
    nums[backwardIdx] = nums[pivotIdx];
    nums[pivotIdx] = tmp;

    // 如果這個 forwardIdx 完全沒前進的話，代表所有人比 pivot 大
    // if (forwardIdx == startIdx + 1) {
    //     // Do nothing
    // } else if (forwardIdx > endIdx) {
    //     int tmp = nums[endIdx];
    //     nums[endIdx] = nums[pivotIdx];
    //     nums[pivotIdx] = tmp;
    // } else {
    //     int tmp = nums[forwardIdx - 1];
    //     nums[forwardIdx - 1] = nums[pivotIdx];
    //     nums[pivotIdx] = tmp;
    // }

    pivotIdx = backwardIdx;

    return pivotIdx;
  }

  void quicksort(vector<int> &nums, int startIdx, int endIdx)
  {
    // base case
    if (startIdx >= endIdx)
    {
      return;
    }

    // general case
    int p = partition(nums, startIdx, endIdx);

    quicksort(nums, startIdx, p - 1);
    quicksort(nums, p + 1, endIdx);
  }

  vector<int> sortArray(vector<int> &nums)
  {
    quicksort(nums, 0, nums.size() - 1);

    return nums;
  }
};

